"use client";

import type React from "react";

import { SiteHeader } from "@/components/layout/site-header";
import { Button } from "@/components/ui/button";
import { Checkbox } from "@/components/ui/checkbox";
import { Label } from "@/components/ui/label";
import {
  Select,
  SelectContent,
  SelectItem,
  SelectTrigger,
  SelectValue,
} from "@/components/ui/select";
import { ArrowLeft } from "lucide-react";
import Image from "next/image";
import { useRouter } from "next/navigation";
import { useState } from "react";

// Types
interface WebsiteSetupFormData {
  webflowConnected?: boolean;
  domainProvider?: string;
  setupEmail?: string[];
  contentFiles?: string[];
  legalPages?: string[];
}

// File Upload Component
const FileUploadArea: React.FC<{
  label: string;
  accept: string;
  placeholder: string;
}> = ({ label, placeholder }) => {
  return (
    <div className="space-y-2">
      <Label className="text-muted-foreground">{label}</Label>
      <div className="border-2 border-dashed border-muted-foreground/25 rounded-lg p-8 text-center hover:border-primary/50 transition-colors">
        <div className="flex flex-col items-center gap-2">
          <div className="w-8 h-8 rounded-full bg-muted flex items-center justify-center">
            <svg
              className="w-4 h-4 text-muted-foreground"
              fill="none"
              stroke="currentColor"
              viewBox="0 0 24 24"
            >
              <path
                strokeLinecap="round"
                strokeLinejoin="round"
                strokeWidth={2}
                d="M7 16a4 4 0 01-.88-7.903A5 5 0 1115.9 6L16 6a5 5 0 011 9.9M15 13l-3-3m0 0l-3 3m3-3v12"
              />
            </svg>
          </div>
          <div className="text-sm">
            <span className="text-primary cursor-pointer hover:underline">
              Click to upload
            </span>
            <span className="text-muted-foreground"> or drag and drop</span>
          </div>
          <p className="text-xs text-muted-foreground">{placeholder}</p>
        </div>
      </div>
    </div>
  );
};

// Header Component
const OnboardingHeader = () => (
  <div className="flex flex-col gap-4">
    <div className="flex gap-2 text-primary items-center cursor-pointer">
      <ArrowLeft className="h-3 w-3" />
      Dashboard
    </div>
  </div>
);

// Video Component
const OnboardingVideo = () => {
  return (
    <div className="flex flex-col gap-4">
      <div className="space-y-0">
        <h1 className="font-semibold text-foreground">3. Website Setup</h1>
        <p className="text-sm text-muted-foreground">
          Start access for website configuration.
        </p>
      </div>

      <div className="relative aspect-video bg-muted rounded overflow-hidden">
        <Image
          src="/video.jpg"
          alt="Website setup consultation video"
          className="w-full h-full object-cover"
          width={300}
          height={300}
        />
        <div className="absolute inset-0 flex items-center justify-center">
          <div className="w-16 h-16 bg-primary/80 rounded-full flex items-center justify-center">
            <div className="w-0 h-0 border-l-[12px] border-l-primary-foreground border-y-[8px] border-y-transparent ml-1"></div>
          </div>
        </div>
      </div>
    </div>
  );
};

function WebsiteSetupPage() {
  const router = useRouter();
  const [formData, setFormData] = useState<WebsiteSetupFormData>({
    setupEmail: [],
  });

  const handleWebflowConnect = (): void => {
    setFormData((prev) => ({
      ...prev,
      webflowConnected: true,
    }));
  };

  const handleDomainProviderChange = (value: string): void => {
    setFormData((prev) => ({
      ...prev,
      domainProvider: value,
    }));
  };

  const handleEmailSetupChange = (service: string, checked: boolean): void => {
    setFormData((prev) => ({
      ...prev,
      setupEmail: checked
        ? [...(prev.setupEmail || []), service]
        : (prev.setupEmail || []).filter((s) => s !== service),
    }));
  };

  const handleNext = (): void => {
    router.push("/dashboard/tracking-analytics");
  };

  const handlePrevious = (): void => {
    router.push("/dashboard/branding-content");
  };

  return (
    <div className="flex flex-col gap-4 min-h-screen">
      <SiteHeader>
        <OnboardingHeader />
      </SiteHeader>

      <div className="flex flex-col gap-2">
        <h2 className="text-3xl font-bold">Onboarding Setup</h2>
        <p className="text-muted-foreground">
          Complete the required steps to ensure a smooth and successful project
          launch.
        </p>
      </div>

      <div className="grid lg:grid-cols-3 gap-8">
        <OnboardingVideo />

        <div className="space-y-6 lg:col-span-2 bg-background p-4 rounded">
          <div className="space-y-6">
            {/* Webflow Account */}
            <div className="space-y-3">
              <Label className="text-muted-foreground">
                Connect WebFlow Account *
              </Label>
              <Button
                variant="outline"
                onClick={handleWebflowConnect}
                className="flex items-center gap-3 px-4 py-2 border font-medium rounded transition-colors bg-transparent"
              >
                <svg
                  width="20"
                  height="20"
                  viewBox="0 0 20 20"
                  fill="none"
                  xmlns="http://www.w3.org/2000/svg"
                  xmlnsXlink="http://www.w3.org/1999/xlink"
                >
                  <rect width="20" height="20" fill="url(#pattern0_60_3404)" />
                  <defs>
                    <pattern
                      id="pattern0_60_3404"
                      patternContentUnits="objectBoundingBox"
                      width="1"
                      height="1"
                    >
                      <use
                        xlinkHref="#image0_60_3404"
                        transform="scale(0.00195312)"
                      />
                    </pattern>
                    <image
                      id="image0_60_3404"
                      width="512"
                      height="512"
                      preserveAspectRatio="none"
                      xlinkHref="data:image/png;base64,"
                    />
                  </defs>
                </svg>
                Connect WebFlow Account
              </Button>
            </div>

            {/* Domain Provider */}
            <div className="space-y-3">
              <Label className="text-muted-foreground">Domain provider *</Label>
              <div className="flex items-center gap-3">
                <Select onValueChange={handleDomainProviderChange}>
                  <SelectTrigger className="flex-1">
                    <SelectValue placeholder="Select domain provider (Fields - Strato, GoDaddy, etc.)" />
                  </SelectTrigger>
                  <SelectContent>
                    <SelectItem value="strato">Strato</SelectItem>
                    <SelectItem value="godaddy">GoDaddy</SelectItem>
                    <SelectItem value="namecheap">Namecheap</SelectItem>
                    <SelectItem value="cloudflare">Cloudflare</SelectItem>
                    <SelectItem value="other">Other</SelectItem>
                  </SelectContent>
                </Select>
                <Button variant="outline" size="sm">
                  Grant access
                </Button>
              </div>
            </div>

            {/* Setup Email */}
            <div className="space-y-3">
              <Label className="text-muted-foreground">Setup email *</Label>
              <div className="space-y-3">
                <div className="flex items-center gap-3">
                  <div className="flex items-center space-x-2">
                    <Checkbox
                      id="google-workspace"
                      checked={formData.setupEmail?.includes("google")}
                      onCheckedChange={(checked) =>
                        handleEmailSetupChange("google", checked as boolean)
                      }
                    />
                    <Label htmlFor="google-workspace" className="text-sm">
                      Google workspace
                    </Label>
                  </div>
                  <div className="flex items-center space-x-2 ml-8">
                    <Checkbox
                      id="microsoft-365"
                      checked={formData.setupEmail?.includes("microsoft")}
                      onCheckedChange={(checked) =>
                        handleEmailSetupChange("microsoft", checked as boolean)
                      }
                    />
                    <Label htmlFor="microsoft-365" className="text-sm">
                      Microsoft 365
                    </Label>
                  </div>
                  <Button
                    variant="outline"
                    size="sm"
                    className="ml-auto bg-transparent"
                  >
                    Grant access
                  </Button>
                </div>
              </div>
            </div>

            {/* Upload Content */}
            <FileUploadArea
              label="Upload content *"
              accept=".docx,.rtf,.pdf,.txt"
              placeholder=".docx, .rtf, .pdf or .txt"
            />

            {/* Upload Legal Pages */}
            <FileUploadArea
              label="Upload legal pages *"
              accept=".docx,.rtf,.pdf,.txt"
              placeholder=".docx, .rtf, .pdf or .txt"
            />
          </div>

          <div className="flex p-2 pt-4 gap-2 justify-end border-t">
            <Button
              variant="outline"
              className="rounded bg-transparent cursor-pointer"
              onClick={handlePrevious}
            >
              Previous
            </Button>
            <Button
              className="rounded bg-primary hover:bg-primary/90 text-primary-foreground cursor-pointer"
              onClick={handleNext}
            >
              Next
            </Button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default WebsiteSetupPage;
